import React from 'react';
import '../assets/css/About.css';

const About = () => {
  return (
    <div className="about-container">
      <h1>About Us</h1>
      <p>We are a company that specializes in providing the best products and services to our customers. Our mission is to deliver high-quality products at an affordable price, while providing excellent customer service.</p>
      <h2>Our Team</h2>
      <p>Our team is made up of experienced professionals who are passionate about what they do. We work together to ensure that our customers receive the best possible experience when working with us.</p>
      <h2>Our History</h2>
      <p>Founded in 2010, our company has grown rapidly over the years. We started as a small business with just a few employees, but now we have a large team and serve customers all over the world.</p>
      <h2>Contact Us</h2>
      <p>If you have any questions or would like to learn more about our products and services, please don't hesitate to contact us. You can reach us by phone, email, or through our website.</p>
    </div>
  );
};

export default About;
